const Api = () => {
    const [data, setData] = useState(null);

    useEffect(() => {
        const fetchData = async () => {
            const result = await axios.post('https://4s2cj3p44k.execute-api.us-east-1.amazonaws.com/beta', {}, {
                timeout: 30000,
                headers: {
                    'x-api-key': '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'
                }
            });
            setData(result.data);
        };
        fetchData();
    }, []);

    return (
        <View>
            {data ? (
                <Text>{data}</Text>
            ) : (
                <Text>Loading...</Text>
            )}
        </View>
    );
};

export default Api;
